import I18nProvider from 'next-translate/I18nProvider'
import React from 'react'
import C from '../../../views/what-is-parkour/index.js'
import ns0 from '../../../locales/ca/common'
import ns1 from '../../../locales/ca/what-is-parkour'

const namespaces = { 'common': ns0, 'what-is-parkour': ns1 }

export default function Page(p){
  return (
    <I18nProvider lang="ca" namespaces={namespaces} >
      <C {...p} />
    </I18nProvider>
  )
}

Page.getInitialProps = C.getInitialProps
